}
.git-log h2 {
  margin: 0px;
  font-family: inherit;
  font-size: 1.1em;
}
.git-log p {
  margin: 0px;
  line-height: inherit;
  padding: 0 1em;
}
.git-log .panels {
  display: -webkit-flex;
  -webkit-flex-direction: row;
  overflow: auto;
}
.git-log .main {
  position: relative;
  white-space: nowrap;
}
.git-log .main h2 {
  border-bottom: rgba(255, 255, 255, 0.5) 1px solid;
  background-color: rgba(0, 0, 0, 0.3);
  padding: 10px 0;
  text-align: center;
}
.git-log .main p {
  position: relative;
  overflow: hidden;
  text-overflow: ellipsis;
  background: #282c34;
}
.git-log .main p span {
  overflow: hidden;
  text-overflow: ellipsis;
  display: block;
}
.git-log .main .list,
.git-log .main .list-head {
  position: relative;
  text-align: left;
  margin: 0 -0.95em;
}
.git-log .info {
  flex-basis: 35%;
  flex-direction: column;
  flex-shrink: 0;
  position: relative;
}
.git-log .info h2 {
  text-align: left;
  line-height: inherit;
  padding: 0 1em;
  flex-shrink: 0;
  border: none;
  background: none !important;
  font-size: 1em;
  font-weight: bold;
}
.git-log .info h2:first-child {
  padding-top: 0.5em;
}
.git-log .info h2 span {
  font-weight: normal;
  font-size: 1em;
  padding-left: 8px;
}
.git-log .info p {
  padding-top: 10px;
  flex-shrink: 0;
}
.git-log .info-image {
  position: absolute;
  top: 0.5em;
  right: 1em;
}
.git-log .info-image img {
  width: 64px;
}
.git-log .info-image img:first-child {
  margin-right: 1px;
}
.git-log .column {
  text-align: center;
  flex: 1 0;
  padding: 0 1em;
}
.git-log .graph {
  position: absolute;
  z-index: 1;
}
.git-log svg {
  margin: 0 1em;
}
.git-log .table {
  width: 100%;
  display: flex;
  flex: 1 0;
}
.git-log .resize-handle {
  position: absolute;
  width: 10px;
  top: 0;
  bottom: 0;
  right: -5px;
  cursor: col-resize;
}
.git-log .added {
  background: url(atom://git-log/resources/added.png);
}
.git-log .deleted {
  background: url(atom://git-log/resources/deleted.png);
}
.git-log .modified {
  background: url(atom://git-log/resources/modified.png);
}
.git-log table {
  table-layout: fixed;
}
.git-log table,
.git-log tbody,
.git-log th,
.git-log td,
.git-log tr {
  border: 0px;
  padding: 1px;
  margin: 0px;
}
.git-log td {
  overflow: hidden;
  text-overflow: ellipsis;
}
.git-log table,
.git-log thead {
  width: 100%;
}
.git-log thead p {
  font-size: 1.1em;
  font-weight: normal;
  padding-top: 8px;
  padding-bottom: 8px;
  text-align: center;
}
.git-log .main tbody tr td:first-child > p:after {
  content: "";
  display: block;
  position: absolute;
  top: 0px;
  bottom: 0px;
  right: 0;
  left: 0;
  z-index: 3;
  opacity: 0;
}
.git-log .comments {
  flex-basis: 70%;
}
.git-log .commit,
.git-log .date,
.git-log .author {
  flex-basis: 10%;
}
.git-log .info {
  margin-top: 2px;
  margin-bottom: 2px;
}
.git-log .info-data {
  margin: 2px;
  margin-bottom: 1px;
  padding-bottom: 8px;
  position: relative;
  background: #282c34;
  flex-shrink: 0;
}
.git-log .info-data p {
  background: none;
  padding-bottom: 1.3em;
}
.git-log .info-file {
  display: flex;
  flex-shrink: 0;
  margin-top: 1px;
  margin-bottom: 2px;
}
.git-log .info-file .list-head {
  border-bottom: solid 1px;
  margin: 0 -0.95em;
}
.git-log .info-file .column {
  text-align: left;
}
.git-log .info-file p {
  background: #282c34;
}
.git-log .info-file tbody tr:last-child p {
  padding-bottom: 4px;
}
.git-log .info-file tbody tr td:nth-child(4),
.git-log .info-file tbody tr td:nth-child(5) {
  text-align: center;
}
.git-log .log-highlight p {
  background-color: #3e4451;
}
